import '../css/page15.css';
import React from 'react'
import anime from "animejs";

function Page15(props){
  let obj1 = document.querySelector('#Page15Signal1');
  if(obj1 !== null) obj1.style.display = '';
  let obj2 = document.querySelector('#Page15Signal2');
  if(obj2 !== null) obj2.style.display = '';
  function animation(){
    anime.timeline().add({
      targets: '#Page15Signal1',
      opacity: 1,
      translateX: -100,
      translateY: 25,
    }, 0).add({
      targets: '#Page15Signal1',
      translateX: 180,
      easing: "linear",
      duration: 2500,
      complete: function() {
        let obj1 = document.querySelector('#Page15Signal1');
        obj1.style.display = 'none';
        anime({
          targets: '#Page15Signal1',
          opacity: 0,
          translateX: -90,
        });
      }
    }).add({
      targets: '#Page15Signal2',
      opacity: 1,
      translateX: -100,
      translateY: 25,
    }, 0).add({
      targets: '#Page15Signal2',
      translateY: 180,
      easing: "linear",
      duration: 2500,
      complete: function() {
        let obj1 = document.querySelector('#Page15Signal2');
        obj1.style.display = 'none';
        anime({
          targets: '#Page15Signal2',
          opacity: 0,
          translateY: -180,
        });
      }
    }, 0);
  }
  if(props.display) animation();

  return(
      <div style={{display: props.display?'': 'none'}}>
        <text className="Page15NodeDes" id="Page15NodeDes1">
          <tspan> Node b<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node1"/>
        <text className="Page15NodeDes" id="Page15NodeDes2">
          <tspan> Node a<br/></tspan>
          <tspan> Term: 0<br/></tspan>
          <tspan> Vote Count: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node2"/>
        <text className="Page15NodeDes" id="Page15NodeDes3">
          <tspan> Node c<br/></tspan>
          <tspan> Term: 0</tspan>
        </text>
        <div className="Page15Node" id="Page15Node3"/>
        <div className="Page15Signal" id="Page15Signal1"/>
        <div className="Page15Signal" id="Page15Signal2"/>
        <div className="Page15Text" id="Page15Text1"> The candidate then requests votes from other nodes. </div>
      </div>
  );
}

export default Page15;
